import React, { useState } from 'react';

const ContainerResource = () => {
    const [resource, setResource] = useState({
        gold: 0,
        iron: 0,
        energy: 0,
    });


    return (
        <div className="containerResource">
            <div className="containerMiniResource">
                <span className="resourceText"> Gold : {resource.gold}</span>
            </div>
        </div>
    );
};

export default ContainerResource;
